import React from "react";
import './StaffView.css';
import img from "../images/FiveFlags.png";

// table components
import AddOperations from "./components/AddOperations";
import Operations from "./components/Operations"

const StaffView = () => {
    return (
        <>
            <div className="staff-page-container">
            <div className="header">
                <h1>Welcome to the Five Flags Park Operations Dashboard!</h1> <img className="small-logo" src={img} alt="company logo"></img>
            </div>
            <div className="redirect">
                <button type="button" onClick>BI Dashboard</button>
            </div>
                <AddOperations />
                <Operations />
            </div>
        </>
    );
};

export default StaffView;
